import React, { useState } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Header from './components/common/Header';
import TabBar from './components/common/TabBar';
import ProfileScreen from './components/screens/ProfileScreen';
import SearchScreen from './components/screens/SearchScreen';
import ExploreScreen from './components/screens/ExploreScreen';
import MessagesScreen from './components/screens/MessagesScreen';
import ChatScreen from './components/screens/ChatScreen';
import Modal from './components/common/Modal';
import { useLanguage } from './contexts/LanguageContext';
import './styles/App.css';
import './styles/responsive.css';

function App() {
  const [activeTab, setActiveTab] = useState('profile');
  const [activeChatUser, setActiveChatUser] = useState(null);
  const [showSettings, setShowSettings] = useState(false);
  const { t, language, changeLanguage, availableLanguages } = useLanguage();

  const renderScreen = () => {
    switch(activeTab) {
      case 'profile':
        return <ProfileScreen />;
      case 'search':
        return <SearchScreen />;
      case 'explore':
        return <ExploreScreen />;
      case 'messages':
        return <MessagesScreen onOpenChat={setActiveChatUser} />;
      default:
        return <ProfileScreen />;
    }
  };

  return (
    <Router>
      <div className="app-container">
        <Header onOpenSettings={() => setShowSettings(true)} />
        <main className="app-content">
          {renderScreen()}
        </main>
        {activeChatUser && (
          <ChatScreen 
            user={activeChatUser} 
            onClose={() => setActiveChatUser(null)} 
          />
        )}
        <TabBar activeTab={activeTab} onTabChange={setActiveTab} />

        {/* Settings Modal */}
        <Modal
          isOpen={showSettings}
          onClose={() => setShowSettings(false)}
          title="Settings"
        >
          <div className="settings-content">
            <div className="settings-section">
              <h3>Account</h3>
              <div className="settings-item">
                <span>Email</span>
                <span className="settings-value">user@example.com</span>
              </div>
              <div className="settings-item">
                <span>Phone</span>
                <span className="settings-value">+1 234 567 8900</span>
              </div>
              <button className="btn btn-outline">Change Password</button>
            </div>

            <div className="settings-section">
              <h3>Notifications</h3>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" defaultChecked />
                  <span>Push Notifications</span>
                </label>
              </div>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" defaultChecked />
                  <span>Email Notifications</span>
                </label>
              </div>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" />
                  <span>SMS Notifications</span>
                </label>
              </div>
            </div>

            <div className="settings-section">
              <h3>Privacy</h3>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" defaultChecked />
                  <span>Show Profile to Others</span>
                </label>
              </div>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" defaultChecked />
                  <span>Allow Messages from Anyone</span>
                </label>
              </div>
              <div className="settings-item">
                <label className="settings-toggle">
                  <input type="checkbox" />
                  <span>Share Location</span>
                </label>
              </div>
            </div>

            <div className="settings-section">
              <h3>About</h3>
              <div className="settings-item">
                <span>Version</span>
                <span className="settings-value">1.0.0</span>
              </div>
              <div className="settings-item">
                <a href="#" className="settings-link">Terms of Service</a>
              </div>
              <div className="settings-item">
                <a href="#" className="settings-link">Privacy Policy</a>
              </div>
            </div>

            <div className="settings-actions">
              <button className="btn btn-outline">Sign Out</button>
              <button className="btn btn-danger">Delete Account</button>
            </div>
          </div>
        </Modal>
      </div>
    </Router>
  );
}

export default App;
